import React from 'react';

import { Container, Content } from './styles';
import logo from '../../assets/logo.svg';

export default function Header() {
  return (
    <Container>
      <Content>
        <nav>
          <img src={logo} alt="" />
          <a>ENCOMENDAS</a>
          <a>ENTREGADORES</a>
          <a>DESTINATÁRIOS</a>
          <a>PROBLEMAS</a>
        </nav>
        <anside>
          <p>Admim</p>
          <p>sair do sistema</p>
        </anside>
      </Content>
    </Container>
  );
}
